const Formulario = () => {
    return ( 
        <div className="row">
            <div className="col s12 m8 offset-m2">
                <form>
                    <h2>Encuentra noticias por categoria</h2>
                    <div className="input-field col s12">

                    </div>
                
                </form>

            </div>
        </div>
     );
}
 
export default Formulario;
